import React from 'react';
import logo from './logo.svg';
import './App.css';

import Home from './components/Home';
import {Routes, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Routes>
      <Nav />
        <Route path= "/" element={<Home />}> </Route>
      </Routes>
    </div>
  );
}

export default App;
